import React from "react";
import "./Header.css";
import Netflix from "./images/netflix-logo.png";

const Header = () => {
  return (
    <div className="container-lg pb-3 d-flex flex-wrap flex-items-start">
      <img
        src={Netflix}
        className="img-fluid netflix-img"
        width={100}
        height={100}
      />
      <h1>Netflix, Inc.</h1>
    </div>
  );
};

export default Header;
